        feature.set({ url: parsedObject.mediaUrl });
        feature.set({ link: parsedObject.clickUrl });
    }
    else {
        feature.set({ url: "https://media-crvox.sfo2.digitaloceanspaces.com/0xf80fe25f8db66727506f2c0b019f28f5211587be/1653530005750-9524fcc5-ef6d-4cee-a871-9e20a9ef1014.jpg" });
